import logo from './logo.svg';
import './App.css';

function App() {
  const buttons = [[1,2,3],[4,5,6],[7,8,9]];
  return (
    <div>
      <h1>Calculator App</h1>
      {buttons.map((buttonRow, rowIndex)=>( 
        <div key={rowIndex}>
        {buttonRow.map((pin)=>(  
          <span key= {pin}>{pin}</span>
        ))}
        </div>
      ))}
     </div>
  );
}

export default App;
